import React from 'react';

function ExperiencePage() {
  return (
    <div className="ExperiencePage">
      <section>
        <blockquote className="Experience-head">
	  "Experience is part of a story from a man. A journey where chapter written. A place where friends and rivals revealed. And a method where skill achieved."
	</blockquote> 
      </section>
    </div>
  );
}

export default ExperiencePage;
